import React, { useState, useContext } from 'react'
import { useNavigate } from 'react-router-dom'
import { AuthContext } from '../contexts/AuthContext'

export default function Login(){
  const [email,setEmail] = useState('')
  const [password,setPassword] = useState('')
  const [err,setErr] = useState(null)
  const [loading,setLoading] = useState(false)
  const { login } = useContext(AuthContext)
  const nav = useNavigate()

  const submit = async e =>{
    e.preventDefault()
    setErr(null)
    setLoading(true)
    try{
      await login(email,password)
      nav('/dashboard')
    }catch(error){
      setErr(error?.response?.data?.message || error?.message || 'Login failed')
    }finally{
      setLoading(false)
    }
  }

  const goSignup = () => {
    nav('/signup')
  }

  return (
    <div className="min-h-screen flex items-center justify-center" style={{background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)'}}>
      <div className="max-w-3xl w-full mx-4 p-8 rounded-2xl shadow-2xl bg-white/95 backdrop-blur-md" style={{display: 'flex', gap: '2rem', alignItems: 'center'}}>
        <div style={{flex:1, padding: '1rem 2rem'}}>
          <div style={{display:'flex', alignItems:'center', gap:12}}>
            <div style={{width:64, height:64, borderRadius:9999, background:'#fff', display:'flex', alignItems:'center', justifyContent:'center', boxShadow:'0 6px 18px rgba(0,0,0,0.12)'}}>
              <span style={{fontSize:28}}>ðŸ’°</span>
            </div>
            <div>
              <h1 style={{margin:0, fontSize:28, fontWeight:700, color:'#0f172a'}}>Finarth</h1>
              <p style={{margin:0, color:'#475569'}}>Personal finance made simple</p>
            </div>
          </div>

          <div style={{marginTop:28}}>
            <h2 className="text-2xl font-semibold" style={{color:'#0f172a'}}>Welcome back</h2>
            <p className="mt-2 text-sm" style={{color:'#475569'}}>Sign in to continue to your dashboard</p>
          </div>
        </div>

        <div style={{width:420, padding:'1rem 2rem'}}>
          <div className="mb-4" style={{textAlign:'center'}}>
            <h3 className="text-xl font-semibold">Sign in</h3>
            <p className="text-sm text-gray-500">Enter your credentials to access your account</p>
          </div>

          {err && <div className="mb-3 text-sm text-red-600 bg-red-50 p-2 rounded">{err}</div>}

          <form onSubmit={submit} className="space-y-3">
            <input
              value={email}
              onChange={e=>setEmail(e.target.value)}
              placeholder="Email"
              type="email"
              required
              className="w-full p-3 rounded border"
              autoComplete="email"
            />

            <input
              value={password}
              onChange={e=>setPassword(e.target.value)}
              type="password"
              placeholder="Password"
              required
              className="w-full p-3 rounded border"
              autoComplete="current-password"
            />

            <button type="submit" disabled={loading} className="w-full p-3 rounded-2xl bg-indigo-600 text-white">
              {loading ? 'Signing in...' : 'Sign in'}
            </button>
          </form>

          <div className="mt-4 text-center">
            <p className="text-sm text-gray-600">Don't have an account?</p>
            <button onClick={goSignup} className="mt-2 inline-block text-sm font-medium text-indigo-700 hover:underline">Create an account</button>
          </div>
        </div>
      </div>
    </div>
  )
}
